You can expect our cleaner to clean your kitchen’s ceiling, walls, and floor. They also wipe the exteriors of appliances, such as your range and dishwasher. This service also covers dusting your tables and chairs, cleaning any items on display, cleaning your sink and drip pans, and disposing of your trash. Cleaners usually include shining your faucets and fixtures as part of the kitchen cleaning checklist.

